/*const ProductItem = (props) => {
    const { productName, unitPrice } = props;
    return (
        <div>
            <p>{productName}</p>
            <p>{unitPrice}</p>
        </div>
    )
}*/

class ProductItem extends Component {

    constructor(props){
        super(props)
    }

    render() {
        const { productName, unitPrice } = this.props;
        return (
            <div>

                <p>{productName}</p>
                <p>{unitPrice}</p>

            </div>
        )
    }
}



export default ProductItem;
